        try {  
            console.log(FormData.note)
            const url = FormData.note ? "/note" : "/journal";   
            const response = await axios.post(url, FormData)
            const result =  response.data
            console.log(result)
        } catch (error) {
            console.log(error)
            
        }

    }  
     send()




